INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 1, 0.0, 4, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24015, 0.0, 10021, 4, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 2, 0.0, 4, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24016, 4.0, 10021, 1, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 3, 0.0, 4, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24017, 0.0, 10021, 4, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 4, 0.0, 1, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24018, 5.2, 10021, 2, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 5, 0.0, 5, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24019, 4.2, 10021, 6, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 6, 0.0, 2, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24020, 0.0, 10021, 2, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 7, 0.0, 1, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24021, 6.4, 10021, 6, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 8, 0.0, 2, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24022, 0.0, 10021, 2, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 9, 0.0, 6, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24023, 10.08, 10021, 3, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 10, 0.0, 1, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24024, 5.0, 10021, 2, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES ("2019/07/31 12:00:00", 11, 0.0, 2, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", 24, 24025, 0.0, 10021, 2, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
